Отлично! API правильно возвращает структуру:
```typescript
{
  success: true,
  data: {
    cleaned: cleanedAddress,  // весь объект от Dadata
    city_fias_id: cleanedAddress.city_fias_id  // отдельно для удобства
  }
}
```

Значит в коде нужно обращаться к `data.data.cleaned.city_fias_id`. Это уже есть! 

